Here is a possible end user API for 3D camera animation in TypeScript:

```typescript
class Camera {
  private _position: Vector3;
  private _rotation: Vector3;
  private _zoom: number;
  private _update: (position: Vector3, rotation: Vector3, zoom: number) => void;

  constructor(position: Vector3, rotation: Vector3, zoom: number) {
    this._position = position;
    this._rotation = rotation;
    this._zoom = zoom;
    this._update = () => {};
  }

  setPosition(position: Vector3): void {
    this._position = position;
    this._update(position, this._rotation, this._zoom);
  }

  setRotation(rotation: Vector3): void {
    this._rotation = rotation;
    this._update(this._position, rotation, this._zoom);
  }

  setZoom(zoom: number): void {
    this._zoom = zoom;
    this._update(this._position, this._rotation, zoom);
  }

  setUpdate(update: (position: Vector3, rotation: Vector3, zoom: number) => void): void {
    this._update = update;
  }
}
```

This class represents a camera that can be positioned, rotated, and zoomed. It also has an `update` method that is called whenever the camera's properties are changed. You can set the update method to any function that takes a position, rotation, and zoom as arguments and updates the camera's state accordingly.

To use this class, you would create a camera instance and pass in the initial position, rotation, and zoom values. You can then call the `setPosition`, `setRotation`, and `setZoom` methods to update the camera's state. Finally, you can set an update method to be called whenever any of these properties change.

Here's an example of how you might use this API:

```typescript
const camera = new Camera(
  new Vector3(0, 0, -5),
  new Vector3(0, 0, 0),
  50,
);

camera.setPosition(new Vector3(0, 0, 10));
camera.setRotation(new Vector3(Math.PI / 2, 0, 0));
camera.setZoom(100);

camera.setUpdate((position, rotation, zoom) => {
  // Update scene based on camera's properties
});
```

This code creates a new camera instance with an initial position at (0, 0, -5), a rotation of (0, 0, 0), and a zoom of 50. It then updates the camera's position to (0, 0, 10), rotates it to a yaw of 90 degrees, and zooms out to a distance of 100 units. Finally, it sets an update method that updates the scene based on the camera's properties.

